import React from 'react';
import logo from './logo.png';

const About = () => {
    return (
        <div class="tc ph4 pa4">
          <h1 class="link b f1 f-headline-ns tc db mb3 mb4-ns hover-red i">BRUNO CUNHA.</h1>
          <article class="mw5 center bg-near-black br3 pa3 pa4-ns mv3 ba b--white-05">
            <div class="tc">
              <img src={logo} class="br-100 h4 w4 dib ba b--white-05 pa2" title="Photo of a kitty staring at you" />
              <h1 class="f3 mb2">Mimi W.</h1>
              <h2 class="f5 fw4 gray mt0"></h2>
            </div>
          </article>
          <p class="f5 f4-m f3-l fw2 mt0 lh-copy">This is my personal portfolio, a work in progress.</p>
          <p class="f5 f4-m f3-l fw2 mt0 lh-copy">Passionate about technology, and everything around it.</p>
          <p class="f5 f4-m f3-l fw2 mt0 lh-copy">Skills in HTML, CSS and JavaScript.</p>
          <p class="f5 f4-m f3-l fw2 mt0 lh-copy">Other skills like React.JS, Node.JS, SQL and NoSQL.</p>
          <div class="bb bw3 pa4 w5 center near-black"> </div>
        </div>
    );
}

export default About;
